'suite/chrome/mailnews/compose/composeMsgs.properties:12599' => 'Паслугач SMTP %S не падтрымлівае прызначаны метад апазнавання. Паспрабуйце, калі ласка, змяніць &#39;Метад апазнавання&#39; у &#39;Наладжваннях рахунку | Выходны паслугача (SMTP)&#39;.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12592' => 'Немагчыма даслаць ліст, бо злучэнне з паслугачом SMTP %S перавысіла часаспын. Паспрабуйце ізноў або звяжыцеся з спраўнікам сеткі.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12593' => 'Немагчыма даслаць ліст з дапамогаю паслугача SMTP %S з невядомай прычыны. Упэўніцеся, калі ласка, што наладжванні вашага паслугача SMTP правільныя і паспрабуйце ізноў, або звяжыцеся з спраўнікам сеткі.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12590' => 'Немагчыма даслаць ліст, бо злучэнне з паслугачом SMTP %S пацярпела няўдачу. Магчыма, паслугач не даступны або адмаўляецца злучацца па SMTP. Упэўніцеся, калі ласка, што наладжванні вашага паслугача SMTP правільныя і паспрабуйце ізноў, або звяжыцеся з спраўнікам паслугача.',
'suite/chrome/mailnews/messenger.dtd:msgMenu.label' => 'Ліст',
'suite/chrome/mailnews/compose/composeMsgs.properties:12596' => 'Паслугач SMTP %S не дазваляе карыстацца простатэкставымі паролямі. Паспрабуйце, калі ласка, выставіць &#39;Тайнапісны пароль&#39; у наладжванні &#39;Метад апазнавання&#39; у &#39;Наладжваннях рахунку | Наладжванні паслугача&#39;.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12597' => 'Немагчыма правесці апазнаванне на паслугачы SMTP %S. Праверце, калі ласка, пароль і &#39;Метад апазнавання&#39; ў &#39;Наладжваннях рахунку | Выходны паслугач (SMTP)&#39;.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12594' => 'Здаецца, што паслугач SMTP %S не падтрымлівае тайнапісныя паролі. Калі вы толькі што наладзілі рахунак, паспрабуйце выставіць &#39;Небяспечная перадача пароля&#39; у наладжванні &#39;Метад апазнавання&#39; у &#39;Наладжваннях рахунку | Наладжванні паслугача&#39;. Калі раней апазнаванне працавала і цяпер раптоўна перастала, гэта можа сведчыць пра тое, што супраць вас хтосьці ўжыў звычайны сцэнар, з дапамогаю якога спрабуе скрасці ваш пароль.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12595' => 'Здаецца, што паслугач SMTP %S не падтрымлівае тайнапісныя паролі. Калі вы толькі што наладзілі рахунак, паспрабуйце выставіць &#39;Звычайны пароль&#39; у наладжванні &#39;Метад апазнавання&#39; у &#39;Наладжваннях рахунку | Наладжванні паслугача&#39;. Калі раней апазнаванне працавала і цяпер раптоўна перастала, паведамце, калі ласка, пра гэта спраўніку э-пошты або дастаўшчыку э-пошты.',
